        [TestMethod]
        public void TestShiftAndXor()
        {
            var input = new byte[][]
            {
                new byte[]{11,174,21,74},
                new byte[]{61,223,25,30},
                new byte[]{60,156,141,148},
                new byte[]{61,84,109,82},
            };
            var expected = new byte[][]
            {
                new byte[]{47,130,150,217},
                new byte[]{171,69,44,84},
                new byte[]{118,217,205,56},
                new byte[]{197,167,155,39},
            };
            var actual = Tools.ShiftAndXor(input);
            Assert.AreEqual(expected.Length, actual.Length);
            for (int i = 0; i < expected.Length; i++)
                CollectionAssert.AreEqual(expected[i], actual[i]);
        }

        [TestMethod]
        public void TestSubstituteForNumberAtIndex()
        {
            var input = new byte[][]
            {
                new byte[]{106,18,194,73},
                new byte[]{250,45,38,85},
                new byte[]{84,136,164,90},
                new byte[]{43,19,63,130},
            };
            var expected = new byte[][]
            {
                new byte[]{88,57,168,164},
                new byte[]{20,250,35,237},
                new byte[]{253,151,29,70},
                new byte[]{11,130,37,17},
            };
            var actual = Tools.SubstituteForNumberAtIndex(input, Tools.DumbList_2);
            Assert.AreEqual(expected.Length, actual.Length);
            for (int i = 0; i < expected.Length; i++)
                CollectionAssert.AreEqual(expected[i], actual[i]);
        }

        [TestMethod]
        public void TestChangeOrder()
        {
            var input = new byte[][]
            {
                new byte[]{106,18,194,73},
                new byte[]{45,38,85,250},
                new byte[]{164,90,84,136},
                new byte[]{130,43,19,63},
            };
            var expected = new byte[][]
            {
                new byte[]{106,18,194,73},
                new byte[]{250,45,38,85},
                new byte[]{84,136,164,90},
                new byte[]{43,19,63,130},
            };
            var actual = Tools.ChangeOrder(input, (index, subIndex) => (subIndex + (4 - index)) % 4);
            Assert.AreEqual(expected.Length, actual.Length);
            for (int i = 0; i < expected.Length; i++)
                CollectionAssert.AreEqual(expected[i], actual[i]);
        }

       [TestMethod]
        public void TestXor()
        {
            var input = new byte[][]
            {
                new byte[]{131,135,211,83},
                new byte[]{22,94,189,206},
                new byte[]{245,239,248,250},
                new byte[]{139,64,190,69}
            };

            var expected = new byte[][]
            {
                new byte[]{106,18,194,73},
                new byte[]{45,38,85,250},
                new byte[]{164,90,84,136},
                new byte[]{130,43,19,63},
            };

            var password = @"?fLY#Uu:U8Ai*(";
            var computedKey = FetcherHelper.MakeKey(@"wawreszuk@gmail.com", password, 5000);
            var expandedKey = Tools.ExpandKey(computedKey);
            var actual = Tools.Xor(input, expandedKey.Length/4 - 1, expandedKey);
            Assert.AreEqual(expected.Length, actual.Length);
            for (int i = 0; i < expected.Length; i++)
                CollectionAssert.AreEqual(expected[i], actual[i]);
        }

