           var actual = Tools.Make4x4(block);
           Assert.AreEqual(expected.Length, actual.Length);
           for (int i = 0; i < expected.Length; i++)
               CollectionAssert.AreEqual(expected[i], actual[i]);
       }

        [TestMethod]
        public void TestGetDataFromSxmlFile()
        {
            var fileContents = @"iterations=5000;!Ar7hkbNQ9pEoxHaSkti+bg==|";
            var expected = new DecryptData 
            {
                data = @"",
                mode = Mode.CBC,
                b64 = true,
                iv = new byte[] {2,190,225,145,179,80,246,145,40,196,118,146,146,216,190,110}

            };
            var result = Tools.GetDataFromSxmlFile(fileContents);
            Assert.AreEqual(expected.data, result.data);
            Assert.AreEqual(expected.data, result.data);
            Assert.AreEqual(expected.mode, result.mode);
            Assert.AreEqual(expected.b64, result.b64);
            CollectionAssert.AreEqual(expected.iv, result.iv);
        }

